import { Link } from 'react-router-dom';

export function Header() {
  return (
    <>
      <h1> Header</h1>
      <Link to="/about">About / </Link>
      <Link to="/user">User / </Link>
      <Link to="/404">404 / </Link>
    </>
  );
};
